s\":\"Toughing out a thumb injury and playing with neither D'Andre Swift (concussion) or Kenny Golladay (hip), Stafford was unable to take advantage of an inviting matchup against a sliding Panthers defense. While his numbers would have looked better had a 51-yard touchdown pass to Marvin Jones not been flagged for an illegal offensive formation, Stafford clearly seemed to be affected by his injury and, given the offense's subsequent struggles moving the ball, it wouldn't be a surprise if Detroit gives Stafford time to heal in the coming weeks. If not, Stafford at least will have an even better matchup in Week 12 against a Texans defense that is allowing the sixth-most yards per pass attempt (7.8) in 2020.\",\"title\":\"Struggles to play through thumb injury\"},{\"timeEpochMilli\":\"1606079329000\",\"contents\":\"Detroit Lions quarterback Matthew Stafford completed 18-of-33 passes for 178 yards in the Lions dreadful 20-0 loss to the Panthers. This performance really stings as Detroit falls to 4-7, ultimately ending any shred of hope for the playoffs. Stafford wore a protective brace over his throwing hand during the game as he is dealing with torn ligaments in his right thumb. The veteran averaged only 5.4 yards per completion and it may be fair to question whether Stafford will play in Week 12 on a ...\",\"url\":\"https://www.rotoballer.com/player-news/matthew-stafford-lays-an-egg-in-carolina/806774\",\"title\":\"Matthew Stafford Lays An Egg In Carolina\"}],\"nameFirst\":\"Matthew\",\"nameLast\":\"Stafford\",\"proTeam\":{\"abbreviation\":\"DET\",\"location\":\"Detroit\",\"name\":\"Lions\"},\"positionEligibility\":[\"QB\"]},\"requestedGames\":[{\"game\":{\"id\":6302,\"away\":{\"abbreviation\":\"DET\",\"location\":\"Detroit\",\"name\":\"Lions\"},\"home\":{\"abbreviation\":\"CAR\",\"location\":\"Carolina\",\"name\":\"Panthers\"},\"startTimeEpochMilli\":\"1606068000000\",\"status\":\"FINAL_SCORE\",\"homeScore\":20,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"160561